import React from 'react';
import './App.css';
import Homebtbg from '../assets/homebtbg.png';
import Homebtiinit from '../assets/btinicio.png';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1> Peça já <br/> sua Pizza! </h1>
        <a href="" className="initbtbg">
        <img src={Homebtiinit} 
        className="App-logo"
         alt="logo" />
         </a>

        <p className="IniciarP">
          Toque Para Iniciar
        </p>
      </header>
    </div>
  );
}

export default App;
